import * as React from "react";
import * as ReasonRelay from "reason-relay/src/ReasonRelay.bs.js";
import * as CategoryListQuery_graphql$NextjsDefault from "../common/__generated__/CategoryListQuery_graphql.bs.js";

var convertResponse = CategoryListQuery_graphql$NextjsDefault.Internal.convertResponse;

var convertVariables = CategoryListQuery_graphql$NextjsDefault.Internal.convertVariables;

var UseQuery = ReasonRelay.MakeUseQuery({
      query: CategoryListQuery_graphql$NextjsDefault.node,
      convertResponse: convertResponse,
      convertVariables: convertVariables
    });

var Query_use = UseQuery.use;

var Query_fetch = UseQuery.$$fetch;

var Query_fetchPromised = UseQuery.fetchPromised;

var Query_preload = UseQuery.preload;

var Query_usePreloaded = UseQuery.usePreloaded;

var Query = {
  Operation: undefined,
  Types: undefined,
  UseQuery: UseQuery,
  use: Query_use,
  $$fetch: Query_fetch,
  fetchPromised: Query_fetchPromised,
  preload: Query_preload,
  usePreloaded: Query_usePreloaded
};

function CategorySelect(Props) {
  return React.createElement("div", undefined, "Category Select");
}

var make = CategorySelect;

export {
  Query ,
  make ,

}
/* UseQuery Not a pure module */
